        Aggregation","code_obj":{"type":"CD","system":"2.16.840.1.113883.5.4","code":"MSRAGG","title":"Rate
        Aggregation"},"value_obj":{"type":"ED","value":"None","media_type":"text/plain"}},{"code":"RAT","value":"Depression
        is a common and treatable mental disorder. The Centers for Disease Control
        and Prevention states that an estimated 6.6% of the U.S. adult population
        (14.8 million people) experiences a major depressive disorder during any given
        12-month period. Additionally, dysthymia accounts for an additional 3.3 million
        Americans. In 2006 and 2008, an estimated 9.1% of U.S. adults reported symptoms
        for current depression (Centers for Disease Control and Prevention, 2010).\n\nPersons
        with a current diagnosis of depression and a lifetime diagnosis of depression
        or anxiety were significantly more likely than persons without these conditions
        to have cardiovascular disease, diabetes, asthma and obesity and to be a current
        smoker, to be physically inactive and to drink heavily (Strine, 2008).\n \nPeople
        who suffer from depression have lower incomes, lower educational attainment
        and fewer days working each year, leading to seven fewer weeks of work per
        year, a loss of 20% in potential income and a lifetime loss for each family
        who has a depressed family member of $300,000 (Smith, 2010). \n\nThe cost
        of depression (lost productivity and increased medical expense) in the United
        States is $83 billion each year (Greenberg, 2003). \n\nPlease note that this
        process measure for administration of the PHQ-9 depression tool, a PROM that
        is validated for both the assessment and diagnosis of depression as well as
        for monitoring ongoing outcomes of treatment, is a PAIRED process measure
        with RELATED measures of depression remission (PHQ-9 \u003c 5) and depression
        response (PHQ-9 is improved by \u003e 50%) at six and twelve months.  To quote
        a NQF Behavioral Steering Committee member as these measures were initially
        endorsed \"the best way to avoid being measured is to never give the PHQ-9\".  This
        process measure allows an understanding of the use of the tool in the target
        population, promotes frequent and follow-up contact with patients whose score
        indicates a need for treatment and serves as a catalyst in a collaborative
        care model for patients with major depression or dysthymia.  It is estimated
        that up to 90% of patients diagnosed with depression and anxiety are treated
        solely in primary care (National Institute for Health and Care Excellence,
        2011).","name":"Rationale","code_obj":{"type":"CD","system":"2.16.840.1.113883.5.4","code":"RAT","title":"Rationale"},"value_obj":{"type":"ED","value":"Depression
        is a common and treatable mental disorder. The Centers for Disease Control
        and Prevention states that an estimated 6.6% of the U.S. adult population
        (14.8 million people) experiences a major depressive disorder during any given
        12-month period. Additionally, dysthymia accounts for an additional 3.3 million
